import React from 'react'
import { useSelector } from 'react-redux'
import { racerChange, selectRacers } from './teamMakerSlice'

function Racer() {
    const racers = useSelector(selectRacers)

    function handleRacerChange (num, type, valye) {
        dispatch(racerChange)
    }

    return (
        <div>
            {   
            racers.map( (element, i) => {
                return(
                    <div key={i}>
                        <label>
                            Name: <input type="text" defaultValue={element.name}></input>
                        </label>
                        <label>
                            Time (mm:ss.ms): <input type="text" defaultValue={`${element.minute}:${element.second}`}></input>
                        </label>
                    </div>
                    )
                })
            }
        </div>
    )
}

export default Racer
